import { Component } from '@angular/core';
import { MatSidenavModule} from '@angular/material/sidenav';
import { SomeJpgFilesComponent } from "../some-jpg-files/some-jpg-files.component";
import { ListBarComponent } from "../list-bar/list-bar.component";

@Component({
    selector: 'app-no-jpg-files',
    templateUrl: './no-jpg-files.component.html',
    styleUrls: ['./no-jpg-files.component.css'],
    standalone: true,
    imports: [MatSidenavModule, SomeJpgFilesComponent, ListBarComponent]
})
export class NoJpgFilesComponent {

}
